        const LoggedIn = () => {
        return (
            <div className="alert alert-success" role="alert">Hello: {username}</div>
        )
    }

    const NotLoggedIn = () => {
        return(

         <div className="alert alert-danger" role="alert">You are not logged in</div>

        );
    };

    return (
        <>
        <div>
            <div className="my-3 py-3 container-md">
                <div className="row">
                    <div className="col-12 mb-5 mt-4">
                        <h1 className="display-6 fw-bolder text-center mb-4 pb-2">Our Products</h1>
                        <div className=" container-products">
                        {loading ? <LoggedIn/> : <NotLoggedIn/>}      
                        </div>       
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}

export default AdminPage;
